import React from 'react';
import ReactDOM from 'react-dom';


const Header = (props) => {
    return(
        <div>
            <h1>
                {props.course}
            </h1>
        </div>
    )
}

const Content = (props) => {
    return(
        <div>
            <p>
                {props.part1} {props.num1}
            </p>
            <p>
                {props.part2} {props.num2}
            </p>
            <p>
                {props.part3} {props.num3}
            </p>

        </div>
    )
}

const Total = () => {
    return(
        <div>
            <p>
               Number of exercises {props.num1 + props.num2} 
            </p>
        </div>
    )

}

const App = () => {
    const course = 'Half Stack application development'
    const part1 = 'Fundamentals of React'
    const exercises1 = 10
    const part2 = 'Using props to pass data'
    const exercises2 = 7
    const part3 = 'State of a component'
    const exercises3 = 14
    return (
      <div>
        <Header course={course} />
        <Content part1={part1} part2={part2} part3={part3} num1={exercises1} num2={exercises2} num3={exercises3}/>
        <Total num1={exercises1} num2={exercises2}/>
      </div>
    )
  }



ReactDOM.render(<App />, document.getElementById('root'));
